import React from "react";
import VoiceChat from "../components/VoiceChat";
import "./Chat.css";
import Navbar from "../components/NavBar";

const Chat = () => {
  return (
    <div className="chat-page">
      <Navbar />
      <VoiceChat />
    </div>
  );
};

export default Chat;
